import React from "react";
import './head_foot.css';


const Header =() => {
    return(
    <header className="all_header">
        <a href="http://hjydomi.duckdns.org:1139">
          <img src={ require('../../img/dm_logo_b.png') } alt="로고"/>
        </a>
        
        
    </header>
    )
}

export default Header;
